import React from "react";
import Table from "rc-table";

const columns = [
  {
    title: "Date",
    dataIndex: "displayDate",
    key: "displayDate"
  },
  {
    title: "RSVPs",
    dataIndex: "rsvped",
    key: "rsvped"
  },
  {
    title: "Attended",
    dataIndex: "attended",
    key: "attended"
  }
];

const AttendanceBySignupDateTable = ({ data }: any) => {
  return <Table className="table" data={data} columns={columns} />;
};

export default AttendanceBySignupDateTable;
